"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 474px\">",
"   <div class=\"ttl\">",
"    Secretin regulation of bicarbonate secretion",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 454px; height: 500px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The presence of gastric acid in the duodenum stimulates the release of secretin from duodenal endocrine cells. Secretin acts through the bloodstream on the pancreatic duct cells to release bicarbonate for neutralization of acid.",
