var title_f43_4_44108="Techniques of the middle phase of Interpersonal Psychotherapy";
var content_f43_4_44108=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PSYCH%2F59989&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PSYCH%2F59989&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Techniques of the middle phase of Interpersonal Psychotherapy",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Technique",
"       </td>",
"       <td class=\"subtitle1\">",
"        Strategy",
"       </td>",
"       <td class=\"subtitle1\">",
"        Comment",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Review depressive symptoms",
"       </td>",
"       <td>",
"        Examine the results of the standardized, self-report depression rating instrument at each session.",
"       </td>",
"       <td>",
"        Patients learn the symptoms of depression as the instrument is reviewed each week. This complements the psychoeducation.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Relate mood to current life events and/or relationships",
"       </td>",
"       <td>",
"        Begin each session with the question, \"How have you been since we last met?\"",
"       </td>",
"       <td>",
"        The clinician directs the patient's attention to a specific time frame (past week) and elicits material about mood and interpersonal life.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Focus on interpersonal problem area",
"       </td>",
"       <td>",
"        Maintain focus on selected problem area.",
"       </td>",
"       <td>",
"        If the clinician has chosen the correct problem area, the relevant material will readily emerge during the session. However, the clinician should explicitly redirect the patient to the problem area as needed.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Build social support",
"       </td>",
"       <td>",
"        Encourage the patient to socialize and connect with positive individuals.",
"       </td>",
"       <td>",
"        Pointing out improvement in mood following socialization often provides the incentive needed to take risks associated with expanding social network.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Provide psychoeducation",
"       </td>",
"       <td>",
"        Utilize the medical model to explore how depression has interfered with effective communication and interpersonal relationships.",
"       </td>",
"       <td>",
"        The clinician blames the depression (rather than the patient) for failures in interpersonal relationships.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Improve communication skills",
"       </td>",
"       <td>",
"        Scrutinize the patient's communication with others and coach her to improve maladaptive patterns.",
"       </td>",
"       <td>",
"        Role play and rehearsals for upcoming interactions can help patients learn more adaptive communication styles.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Explore options",
"       </td>",
"       <td>",
"        Ask the patient what she wants in a given situation.",
"       </td>",
"       <td>",
"        Depressed patients may have difficulty imagining that options exist, thus the clinician may initially need to be active and suggest options.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Behavioral activation",
"       </td>",
"       <td>",
"        Encourage socializing and activity.",
"       </td>",
"       <td>",
"        Socialization and pleasurable activities are inherently antidepressant.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Maintain the therapeutic alliance",
"       </td>",
"       <td>",
"        The clinician encourages the patient to express affect in sessions, is supportive and encouraging, and addresses ruptures in the therapeutic alliance.",
"       </td>",
"       <td>",
"        Although IPT is not a transference focused therapy, the clinician may observe transference reactions that arise in the course of IPT and use this material to inform treatment. It is not discussed explicitly with the patient.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Support and highlight therapeutic gains",
"       </td>",
"       <td>",
"        The clinician explicitly encourages and praises treatment gains and progress.",
"       </td>",
"       <td>",
"        The clinician's optimism and encouragement are used to counteract the depressed patient's negative thoughts and feelings, and support her emerging sense of self-efficacy.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
